import './App.css';
import logo from "../public/assets/logo.png"

function App() {
  return (
    <div className="App" style={{backgroundImage: "url(/assets/bg-web.png)", backgroundSize: "cover", minHeight: "100vh" }}>
      <div className="header">
        <img src="url(/assets/logo.png)" />
      </div>
    </div>
  );
}

export default App;
